			"notes": {
				"05b645eb-b91e-4e62-81b4-efad63ccddb4": {
					"title": "Well Cavern",
					"text": "<div class=\"read-aloud-text\">\n<p><span style=\"font-size: 14pt;\">The smell of damp earth, tinged with acrid rot, fills your nose. What looks like the remains of an underground river snakes through this cavern, though a pile of dark rocks blocks its headstream. In the far corner is the source of that scent: a pile of carrion and sewage being dragged by a fleshy, three-legged creature.</span></p>\n</div>",
					"plain": "The smell of damp earth, tinged with acrid rot, fills your nose. What looks like the remains of an underground river snakes through this cavern, though a pile of dark rocks blocks its headstream. In the far corner is the source of that scent: a pile of carrion and sewage being dragged by a fleshy, three-legged creature.",
					"player": false,
					"statBlock": false
				},
				"21874769-6652-42bd-8f51-958c0a668109": {
					"title": "Cave In",
					"text": "<p data-content-chunk-id=\"53a38e2b-b66a-4a5a-abd0-bf43174db2a5\"><span style=\"font-size: 14pt;\"><em><strong>Cave-In.</strong></em> It takes 1 hour for a character to dig out the tunnel. If more characters help, the time it takes to dig out the tunnel decreases by 10 minutes per character, to a minimum of 10 minutes total.</span></p>\n<p data-content-chunk-id=\"5c4b2c29-460a-4bcb-813c-0848f82e5040\"><span style=\"font-size: 14pt;\">The cleared northern tunnel leads eastward to a mountainous outcropping near Zorzula&rsquo;s Rest, though the mining outpost itself isn&rsquo;t visible from the exit of the tunnel. At your discretion, the characters could enter Zorzula&rsquo;s Rest from this point, though they should investigate additional crime scenes first.</span></p>",
					"plain": "Cave-In. It takes 1 hour for a character to dig out the tunnel. If more characters help, the time it takes to dig out the tunnel decreases by 10 minutes per character, to a minimum of 10 minutes total.The cleared northern tunnel leads eastward to a mountainous outcropping near Zorzulas Rest, though the mining outpost itself isnt visible from the exit of the tunnel. At your discretion, the characters could enter Zorzulas Rest from this point, though they should investigate additional crime scenes first.",
					"player": false,
					"statBlock": false
				}
			},
